import {Navbar, Container, Row, Col} from "react-bootstrap";
import Image from 'react-bootstrap/Image'


//will be imported in the _app component for all pages
//color: 64AB8A
//needs to be made sticky

const navbar = {backgroundColor: "#64AB8A"}
var style = {align: center}
class Footer extends React.Component {
  render() {
    return(
      <div className="fixed-bottom">  
      <Navbar style={navbar}>
          <Container>
            <Col>
              <Row>
              <div style={{display: 'flex', justifyContent: 'center'}}>
                <div><Image src="./images/github.png" width = "15" height = "15"/></div>
              </div>

                <Image src="./images/fb.png" width = "15" height = "15"/>
                <Image src="./images/insta.png" width = "15" height = "15"/>
              </Row>
              <Row>
                <Image src="./images/H4I_green.png" width = "15" height = "15"/>
              </Row>
            </Col>

          </Container>
      </Navbar>
      </div>
  )
  }
}

export default Footer;
